const UsersTable = ({item}) => {
    return (
        <tr>
            <td>{item.userName}</td>
            <td>{item.email}</td>
            <td>{item.lastName}</td>
            <td>{item.phoneNo}</td>
            <td>{item.address}</td>
            <td>Manager</td>
            <td> actions={[
          {
            icon: "edit",
            tooltip: "Edit User",
            onClick: (event, rowData) => alert("You Edit " + rowData.name),
          },
          (rowData) => ({
            icon: "delete",
            tooltip: "Delete User",
            onClick: (event, rowData) =>
              window.confirm("You want to delete " + rowData.name),
            disabled: rowData.birthYear < 2000,
          }),
        ]}</td>
        </tr>
    );
}

export default UsersTable
